@Component({
  selector: 'add-file',
  templateUrl: './assignment.component.html',
  styleUrls:['./assignment.component.css']
})
export class Assignmentcomponent {
    name: String="";
    constructor(){}

    update(event : any){
    console.log(event);
    this.name=event.target.value;
}
}
<div class="banner">
